import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/Header/Header';
import HomePage from './components/HomePage/HomePage';
import Words from './components/Words/Words';
import Word from './components/Words/Word';
// import HomePage from './components/HomePage';
function App() {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/words" element={<Words></Words>}></Route>
        <Route path="/words/:wordId" element={<Word />} />  // Add this line
        <Route path="/school" element={<HistoryView></HistoryView>}></Route>
        <Route path="/login" element={<LoginView></LoginView>}></Route>
        <Route path="/user" element={<UserView></UserView>}></Route>
        <Route path="/signup" element={<SignupView></SignupView>}></Route>
        <Route path="/user/change-username" element={<UsernameView></UsernameView>}></Route>
        <Route path="/user/change-password" element={<PasswordView></PasswordView>}></Route>
      </Routes>
    </Router>
  );
}

export default App;





